/* This example requires Tailwind CSS v2.0+ */
import React, {Fragment, useEffect, useState} from 'react'
import { Disclosure, Menu, Transition } from '@headlessui/react'
import axios from "axios";
import {useParams} from "react-router-dom";


const people = [
    {
        name: 'Michael Foster',
        role: 'Co-Founder / CTO',
        imageUrl:
            'https://images.unsplash.com/photo-1519244703995-f4e0f30006d5?ixlib=rb-=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=facearea&facepad=8&w=1024&h=1024&q=80',
    },
    // More people...
]


function classNames(...classes) {
    return classes.filter(Boolean).join(' ')
}

export const Event = () => {

    const [event, setEvent] = useState({})
    const [pickedGenres, setPickedGenres] = useState([])

    const {eventId} = useParams()

    console.log("load")

    const getEvent = () =>{

        axios.get(`/api/public/get-event/${eventId}`)
            .then(res=>{
                setEvent(res.data)

            })
            .catch(error=>{
                console.log(error)
            })

    }

    const handlePick = (genre) =>{

        if(pickedGenres.includes(genre)){
            const arr = pickedGenres.filter(gen => gen.name !== genre.name)
            setPickedGenres(arr)
        }else{
            setPickedGenres([...pickedGenres, genre])
        }

    }

    useEffect(()=>{
        getEvent()
    },[])




    return (


            <div className="min-h-full">
                <div className="bg-white border-b border-gray-200 max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
                    <div className="flex justify-between h-16">
                        <div className="flex">
                            <div className="flex-shrink-0 flex items-center">
                                <img
                                    className=" h-8 w-auto"
                                    src="https://tailwindui.com/img/logos/workflow-logo-indigo-600-mark-gray-800-text.svg"
                                    alt="Workflow"
                                />
                            </div>

                        </div>
                    </div>
                </div>

                <div className="py-10">

                    <main>
                        <div className="max-w-7xl mx-auto sm:px-6 lg:px-8">
                            {/* Replace with your content */}
                            <div className=" px-4 py-8 sm:px-0">
                                <div className="space-y-8 sm:space-y-12">
                                    <div className="space-y-5 sm:mx-auto sm:max-w-xl sm:space-y-4 lg:max-w-5xl">
                                        <h2 className="text-center text-3xl font-extrabold tracking-tight sm:text-4xl">{event.name}</h2>
                                        <div className=" flex justify-center gap-3">
                                            <p className="text-xl text-gray-500">
                                                {event?.date?.slice(0,10)}
                                            </p>
                                            <p className="text-xl text-gray-500">
                                                {event.location}
                                            </p>

                                        </div>
                                        <p className="text-center text-xl text-gray-500">
                                            {event.description}
                                        </p>


                                    </div>
                                    <ul
                                        role="list"
                                        className="mx-auto grid grid-cols-2 gap-x-4 gap-y-8 sm:grid-cols-4 md:gap-x-6 lg:max-w-5xl lg:gap-x-8 lg:gap-y-12 xl:grid-cols-6"
                                    >
                                        {event?.genres?.map((genre) => (
                                            <a key={genre.name} onClick={()=>handlePick(genre)} className="cursor-pointer">
                                            <li key={genre.name}>
                                                <div className="space-y-4">
                                                    <img className="mx-auto h-20 w-20 rounded-full lg:w-24 lg:h-24 " src={genre.imageUrl} alt="" />
                                                    <div className="space-y-2">
                                                        <div className="text-center text-xs font-medium lg:text-sm">
                                                            <h3>{genre.name}</h3>
                                                            {pickedGenres.includes(genre) &&
                                                                <span className="inline-flex items-center rounded-md bg-sky-50 px-2 py-1 text-xs font-medium text-sky-400 ring-1 ring-inset ring-sky-400/10">
                                                                    Picked
                                                                </span>
                                                            }

                                                        </div>
                                                    </div>
                                                </div>
                                            </li>
                                            </a>
                                        ))}
                                    </ul>
                                </div>
                            </div>
                            <div className="mt-6 flex items-center justify-center gap-x-6">
                                <button
                                    onClick={()=>alert('click')}
                                    type="submit"
                                    className="rounded-md w-full bg-sky-400 px-3 py-2 text-sm font-semibold text-white shadow-sm hover:bg-sky-500 focus-visible:outline focus-visible:outline-2 focus-visible:outline-offset-2 focus-visible:outline-sky-400"
                                >
                                    Go to event page
                                </button>
                            </div>
                        </div>
                    </main>
                </div>
            </div>

    )
}
